//Alecto, a userscript to gather tb comments

function AlectoNative(){
    this.fuckCapitalist = ()=>{
        console.log("");
    };
}

function AlectoAssets(){
    this.fontGeometos = `data:application/font-woff;base64,`
    this.fontSourceHan = `data:application/font-woff;base64,`
}

function Alecto(){
    const log = (x)=>{
        console.log("[Alecto] "+x);
    };
    const formatEllipsis = (str = '', limitLen = 48)=>{
        let 
          len = 0,
          reg = /[\x00-\xff]/, 
          strs = str.split(''),
          inx = strs.findIndex(s => {
            len += reg.test(s) ? 1 : 2
            if (len > limitLen) return true
          })
        return inx === -1 ? str : str.substr(0, inx) + '...';
    };

    const xhrGet = async (url,binary = false)=>{
        let response = await window.fetch(url);
        if(binary){
            return await response.blob();
        }
        return await response.text();
    };
    
    const jsonpInjection = async (url) =>{
        let setScript = document.createElement("script");
        setScript.setAttribute("type", "text/javascript");
        setScript.setAttribute("src", url);
        document.body.insertBefore(setScript, document.body.lastChild);
        this.attr.jsonpResolved = false;
        await new Promise((resolve,reject)=>{
            setTimeout(()=>{
                reject();
            },30000);
            let timerId = setInterval(()=>{
                if(this.attr.jsonpResolved){
                    resolve();
                    clearInterval(timerId);
                }
            },1000);
        });
        return this.attr.jsonpContent;
    };

    const jsonpCallbackInjection = ()=>{
        window.jsonp_tbcrate_reviews_list  = (x)=>{
            this.attr.jsonpResolved = true;
            this.attr.jsonpContent = x;
            return x;
        };
    };

    const reOverridingNativeMethods = ()=>{
        var _frame = document.createElement('iframe');
        document.body.appendChild(_frame);
        const recoverMethod = (parentPrototype = window, methodName = "", alias = "") => {
            parentPrototype[methodName] = _frame.contentWindow[methodName];
            if(!(alias in this.native)){
                this.native[alias] = function(){};
            }
            this.native[alias][methodName] = _frame.contentWindow[methodName];
        };
        const recoverList = [
            {
                proto:XMLHttpRequest.prototype,
                alias:"XHR",
                methods:['send','open']
            },
            {
                proto:window,
                alias:"window",
                methods:['fetch']
            }
        ];
        recoverList.forEach((el)=>{
            el.methods.forEach((elx)=>{
                recoverMethod(el.proto,elx,el.alias);
                this.log("Recovered native function:"+el.alias+"-"+elx);
            });
        });
        _frame.style.display = "none";
    };

    const locateJsonpAddress = ()=>{
        let htmlHead = document.getElementsByTagName("head")[0].childNodes;
        let destAddr = "";
        htmlHead.forEach((el)=>{
            if('src' in el){
                let matchDest = /feedRateList.htm/g;
                if(el.src.match(matchDest)!=null){
                    destAddr = el.src;
                }
            }
        });
        this.log("Find comment JSONP URI:"+destAddr);
        return destAddr;
    };

    const findJsonpBody = async ()=>{
        let uri = this.locateJsonpAddress();
        let commentLists = [];
        let curIndex = 1;
        while(true){
            this.jsonpCallbackInjection();
            this.setBannerInfo(this.lang.loadComments+" (Page:"+curIndex+", Items:"+commentLists.length+")",false);
            let rpUri = uri.replace(/currentPageNum.?[0-9]+/,"currentPageNum="+curIndex);
            let respBody = await this.jsonpInjection(rpUri);
            if(!('comments' in respBody)||respBody.comments.length == 0){
                break;
            }
            if(respBody.currentPageNum==respBody.maxPage){
                break;
            }
            let content = respBody.comments;
            commentLists = commentLists.concat(content);
            curIndex++;
            await new Promise((r)=>{
                setTimeout(()=>{
                    r();
                },2000);
            });
        }
        
        return commentLists;
    };

    const analyzeComments = (commentObject)=>{
        let exportedObjectList = [];
        commentObject.forEach((el)=>{
            let exportedObject = {};
            exportedObject.date = el.date;
            exportedObject.photos = (()=>{
                let tw = [];
                el.photos.forEach((elx)=>{
                    tw.push(elx.url.replace(/_400x400\.jpg$/g,""));
                });
                return tw;
            })();
            exportedObject.video = (()=>{
                if(el.video != null){
                    return el.video.cloudVideoUrl;
                }
                return null;
            })();
            exportedObject.content = el.content;
            exportedObject.user = el.user.nick;
            exportedObjectList.push(exportedObject);
        });
        return exportedObjectList;
    };
    
    const resolveDependencies = async ()=>{
        let dependencies = [
            'https://cdnjs.cloudflare.com/ajax/libs/jszip/3.10.1/jszip.js',
            'https://cdn.bootcdn.net/ajax/libs/FileSaver.js/2.0.5/FileSaver.js'
        ];
        for(let i=0;i<dependencies.length;i++){
            let x = await this.xhrGet(dependencies[i]);
            window.eval(x);
            this.setBannerInfo(this.lang.loadDeps+":"+dependencies[i],false);
            this.log("Resolved dependency:"+dependencies[i]);
        }
        this.log("All dependencies are loaded.");
    };

    const createZip = async (analyzedResult)=>{
        var zip = new JSZip();
        let idx = 0;
        let size = 0;
        for(let i=0;i<analyzedResult.length;i++){
            this.setBannerProg(40+40*(i/analyzedResult.length));
            this.log("Gathering resource, at index:"+i+" / "+analyzedResult.length);
            let el = analyzedResult[i];
            let folder = zip.folder(el.date+"-"+el.user);
            
            for(let j=0;j<el.photos.length;j++){
                this.setBannerInfo(this.lang.download+" ("+i+" / "+analyzedResult.length+", "+this.lang.downloaded+":"+ parseInt(size/1024/1024) +"MB ):"+this.formatEllipsis(el.photos[j].replace(/\/\//g,"")),false);
                this.log("Fetching image resource:"+el.photos[j].replace(/\/\//g,""));
                let x = await this.xhrGet("https:"+el.photos[j],true);
                size+=x.size;
                await new Promise((r)=>{
                    setTimeout(()=>{
                        r();
                    },200);
                });
                folder.file(j+".jpg",x);
            }
            if(el.video!=null){
                this.setBannerInfo(this.lang.download+" ("+i+" / "+analyzedResult.length+", "+this.lang.downloaded+":"+ parseInt(size/1024/1024) +"MB ):"+this.formatEllipsis(el.video.replace(/\/\//g,"")),false);
                this.log("Fetching video resource:"+el.video);
                let x = await this.xhrGet("https:"+el.video,true);
                size+=x.size;
                folder.file("attachment.mp4",x);
            }
            folder.file("comment.txt",el.content);
        }
        this.setBannerProg(80);
        this.setBannerInfo(this.lang.bundle,false);
        let content = await zip.generateAsync({type:"blob"});
        saveAs(content, "example.zip");
    };
    
    const run = async ()=>{
        try {
            this.setBannerInfo(this.lang.starts,false);
            await this.resolveDependencies();
            this.setBannerProg(20);
            this.setBannerInfo(this.lang.loadComments,false);
            this.log("Loading comments");
            this.simStartup();
            await new Promise((r)=>{
                setTimeout(()=>{
                    r();
                },2000);
            });
            this.setBannerProg(40);
            this.log("Comments are loaded");
            let commentObject = await findJsonpBody();
            let analyzedResult = this.analyzeComments(commentObject);
            console.log(commentObject)
            this.log("Analysis is done.");
            console.log(analyzedResult);
            await this.createZip(analyzedResult);
            this.setBannerInfo(this.lang.alldone,true);
            this.log("Process is done.");
            this.setBannerProg(100);
        } catch (error) {
            this.setBannerInfo(this.lang.error,true);
            this.log("ERROR OCCURS");
            console.log(error);
        }
        
    };

    const init = (inTamperMonkey = false)=>{
        this.setupBanner();
        this.setBannerInfoX(this.lang.reoverride,false);
        this.setBannerInfo(this.lang.reoverride,false);
        this.reOverridingNativeMethods();
        this.setBannerInfo(this.lang.initdone,true);
        this.log("Initialization is done.");
    };

    const simStartup = ()=>{
        let btns = document.getElementsByClassName('tb-tab-anchor');
        for(let i=0;i<btns.length;i++){
            if(btns[i].innerHTML.match(/\&nbsp;\&nbsp;/g)!=null){
                btns[i].click();
            }
        }
    };

    const setupBanner = ()=>{
        let w = document.createElement("div");
        w.style.position = "fixed";
        w.style.top = "0px";
        w.style.left = "0px";
        w.style.width = "100%";
        w.style.zIndex = "114514191"; //?
        w.innerHTML = this.lang.startup;
        w.style.height = "40px";
        w.style.backgroundColor = "#0b0b0b";
        w.style.color = "#e3e3e3";
        w.style.fontWeight = "bold";
        w.style.paddingLeft = "25px";
        w.style.paddingTop = "11px";
        w.style.paddingBottom = "10px";
        w.style.fontSize = "15px";
        w.style.fontFamily = "'Microsoft YaHei',Tahoma,Helvetica,Arial,'宋体',sans-serif";
        w.style.borderBottom = "2px solid #232323";
        w.style.verticalAlign = "top";
        w.style.display = "table-cell";
        w.style.userSelect = "none";
        document.body.appendChild(w);
        this.attr.bannerObj = w;
    };
    const setBannerProg = (x)=>{
        this.attr.bannerProg = x;
        document.getElementById('alecto-progressbar').style.width = x+"%";
    };
    const setBannerInfo = (x,showBtn)=>{
        document.getElementById("alecto-body").innerHTML = x;
        if(showBtn==="def"){
            return;
        }
        if(showBtn){
            document.getElementById("alecto-btn-a").style.display = "inline";
        }else{
            document.getElementById("alecto-btn-a").style.display = "none";
        }
    };

    const setLang = (x)=>{
        if(x=="en"){
            this.lang = this.en_langs;
        }
        this.setBannerInfoX(this.lang.langChanged,true);
        this.setBannerInfo(this.lang.langChanged,"def");
    };

    const setBannerInfoX = (x,showBtn)=>{
        let w = this.attr.bannerObj;
        let styleInject = `
            
            <style>
                @font-face{
                    font-family:Geometo;
                    src:url('`+this.assets.fontGeometos+`');
                }
                @font-face{
                    font-family:SourceHan;
                    src:url('`+this.assets.fontSourceHan+`');
                }
                .alecto-btn{
                    background-color:#76ddff;
                    color:#000000;
                    border-radius:3px;
                    padding-left:11px;
                    padding-top:6px;
                    padding-right:11px;
                    padding-bottom:6px;
                    margin-left:12px;
                }
                .alecto-btn:hover{
                    text-decoration:none;
                }
                .alecto-right{
                    float:right;
                    margin-right:60px;
                    padding-top:10px;
                }
                .alecto-title{
                    font-size:25px;
                    font-weight:bold;
                    padding-top:2px;
                    display:inline-block;
                    margin-right:15px;
                    color:#10b2ff;
                    font-family:'Geometo';
                    
                }
                .alecto-body{
                    display:inline-block;
                    transform: translateY(-3px);
                    font-family:'SourceHan';
                }
                .alecto-progressbar{
                    background-color:#76ddff;
                    height:4px;
                    position:fixed;
                    left:0px;
                    top:0px;
                    transition:all 0.5s;
                }
            </style>
            <div class='alecto-progressbar' id='alecto-progressbar' style='width:`+this.attr.bannerProg+`%;'>
                
            </div>
        `;
        let inj = "";
        
        inj += `
            <span class='alecto-title'>Alecto</span>
        `;
        inj += styleInject;

        inj += `
            <span class='alecto-body' id='alecto-body'>
        `+x+`</span>`;

        inj += "<span class='alecto-right'>";
        inj += `  <a class="alecto-btn" id='alecto-btn-a' href='javascript:void(0)' onclick='window.alecto.run()'>`+this.lang.runLabel+`</a>`;
        inj += `  <a class="alecto-btn" href='javascript:void(0)' onclick='alert("by Aeroraven. Version v0.1b. Repo:https://github.com/Aeroraven/Alecto")'>`+this.lang.about+`</a>`;
        inj += `  <a class="alecto-btn" href='javascript:void(0)' onclick='window.alecto.setLang("en")'>English</a>`;
        inj += "</span>";
        w.innerHTML = inj;
    };


    //Defining Methods

    this.xhrGet = xhrGet;
    this.log = log;
    this.reOverridingNativeMethods = reOverridingNativeMethods;
    this.init = init;
    this.native = new AlectoNative();
    this.locateJsonpAddress = locateJsonpAddress;
    this.findJsonpBody = findJsonpBody;
    this.jsonpInjection = jsonpInjection;
    this.jsonpCallbackInjection = jsonpCallbackInjection;
    this.run = run;
    this.analyzeComments = analyzeComments;
    this.resolveDependencies = resolveDependencies;
    this.createZip = createZip;
    this.simStartup = simStartup;
    this.setupBanner = setupBanner;
    this.setBannerInfo = setBannerInfo;
    this.setBannerProg = setBannerProg;
    this.setBannerInfoX = setBannerInfoX;
    this.formatEllipsis = formatEllipsis;
    this.setLang = setLang;

    //Attributes
    this.attr = {
        jsonpResolved:false,
        jsonpContent:"",
        bannerObj:null,
        bannerProg: 0
    };
    
    this.zh_langs = {
        startup:"脚本正在初始化",
        reoverride:"正在重载原生方法",
        initdone:"已就绪，选择启动抓取开始任务",
        loadDeps:"正在加载依赖",
        loadComments:"正在加载评论",
        starts:"任务正在开始",
        download:"正在下载资源",
        downloaded:"已下载",
        bundle:"正在打包文件",
        alldone:"已完成抓取任务，检查浏览器下载查看结果。",
        runLabel:"启动抓取",
        about:"版本信息",
        error:"发生错误，按下F12后选择控制台选项卡查看错误信息",
        langChanged:"已将语言调整为 简体中文(Simplified Chinese)"
    };

    this.en_langs = {
        startup:"Initializing",
        reoverride:"Recovering native JavaScript methods",
        initdone:"Alecto is ready. Click `Start` to initiate the task",
        loadDeps:"Loading dependencies",
        loadComments:"Loading comments",
        starts:"Now starting",
        download:"Downloading resources",
        downloaded:"Downloaded",
        bundle:"Now packing bundles",
        alldone:"The task has been finished. Check your browser to find the final file.",
        runLabel:"Start",
        about:"About",
        error:"Error occurs, press F12 to get technical report.",
        langChanged:"Language has been changed succesfully!",
    };

    this.lang = this.zh_langs;
    this.assets = new AlectoAssets();
}

//Injecting
const alecto = new Alecto();
window.alecto = alecto;

//Init
alecto.init();
